def main(race):
    i = 0
    namelist = []
    while(i < 12):
        start_syllabels = start_get_syllabels(race)
        r_ss = random.sample(start_syllabels, 1)
        end_syllabels = end_get_syllabels(race)
        r_es = random.sample(end_syllabels, 1)
        r_name = r_ss[0] + r_es[0]
        if check_name(r_name):
            i += 1
            namelist.append(r_name)
    return namelist
            

def check_name(name):
    for index, c in enumerate(name):
        if c == name[index + 1] and c == name[index + 2]:
            return False
        elif c == name[-3]:
            return True
            
def count_syllables(word):
    v = "aeiouy"
    v_set = set(v)
    count = 0
    l_word = word.lower()
    for c in l_word:
        if c in v_set:
            count += 1
        if l_word[-1] == "e":
            count -= 1
        return count

def start_get_syllabels(race):
    names = namebank[race]
    syl_start_all = set()
    for name in names:
        syl_start = name[:2]
        syl_start_all.add(syl_start)
    return syl_start_all

def end_get_syllabels(race):
    names = namebank[race]
    syl_end_all = set()
    for name in names:
        syl_end = name[3:]
        syl_end_all.add(syl_end)
    return syl_end_all

